import Head from 'next/head'
import Link from 'next/link'    

function Random({data}) {

    return (
        <>
          <Head>
            <title>Micro | Random</title>
          </Head>  

          <main className="container mt-12 mx-auto">
            <h1 className="text-3xl">
                Fecthing random words
            </h1>
            <ul>
                {
                    data.map(todo => {
                        return <li key={todo.id} className='border border-gray-600 p-4 my-1'>
                            {todo.title ?? "-"} 
                            <Link href={`/random/${todo.id}`} >
                                <a className='' >launch</a>
                            </Link> 
                        </li>
                    })
                }
            </ul>

          </main>
        </>
    )
}

Random.getInitialProps = async () => {
    try {
        const data = await fetch('https://jsonplaceholder.typicode.com/todos')
            .then(response => response.json())
            .then(json => json)
            return {data}
    } catch (error) {
        
    }
}

export default Random
